import React from 'react';
import { Link } from 'react-router-dom'

export function loadWarns(warns, user) {
    if (warns.length <= 0) {
        return (
            <span>No Warns</span>
        )
    } else {
        return (
            <ul>
                <h4 className="warn-title">{user.username} has {warns.length} {warns.length == 1 ? 'warning' : 'warns'}</h4>
                {
                    warns.map(warn => {
                        return (
                            <li className="warn-li">
                                <span>Punishment ID: {warn.punishmentId}</span>
                                <span>Moderator: <a onClick={() => window.open(``)}>{warn.moderator}</a></span>
                            </li>
                        )
                    })
                }
            </ul>
        )
    }
}
